import React from 'react';
import Section from './Section';
import MarkdownHeader from './MarkdownHeader';
import LineBreak from './LineBreak';
import Text from './Text';

import { ReactComponent as JavaScriptIcon } from '../assets/images/skills/JSIcon.svg'; // Import SVG as a React component

function Skills() {
  return (
    <div>
      <Section>
        <MarkdownHeader headingLevel="1" text="Skills" className="text-3xl md:text-5xl" />
        <LineBreak />
        <Text>Here are some of the technologies and tools I work with:</Text>

        <Section>
          <MarkdownHeader headingLevel="2" text="Front-end" className="text-xl md:text-3xl" />
          <LineBreak />
          <div className="flex flex-wrap gap-4">
            <div className="relative group">
              <JavaScriptIcon className="w-24 h-24" />
              <div className="absolute inset-0 flex items-center justify-center text-white bg-black bg-opacity-70 opacity-0 group-hover:opacity-100 transition-opacity">
                JavaScript
              </div>
            </div>
            {/* Add more icons as needed */}
          </div>
        </Section>

        {/* Add more sections for other skill categories */}
      </Section>
    </div>
  );
}

export default Skills;
